core::slice::<impl [T]>::iter.doc:
Returns an iterator over the slice.

The iterator yields all items from start to end.

# Examples

```
let x = &[1, 2, 4];
let mut iterator = x.iter();

assert_eq!(iterator.next(), Some(&1));
assert_eq!(iterator.next(), Some(&2));
assert_eq!(iterator.next(), Some(&4));
assert_eq!(iterator.next(), None);
```

core::iter::Iterator::map.doc:
Takes a closure and creates an iterator which calls that closure on each
element.

`map()` transforms one iterator into another, by means of its argument:
something that implements [`FnMut`]. It produces a new iterator which
calls this closure on each element of the original iterator.

If you are good at thinking in types, you can think of `map()` like this:
If you have an iterator that gives you elements of some type `A`, and
you want an iterator of some other type `B`, you can use `map()`,
passing a closure that takes an `A` and returns a `B`.

`map()` is conceptually similar to a [`for`] loop. However, as `map()` is
lazy, it is best used when you're already working with other iterators.
If you're doing some sort of looping for a side effect, it's considered
more idiomatic to use [`for`] than `map()`.

[`for`]: ../../book/ch03-05-control-flow.html#looping-through-a-collection-with-for

# Examples

Basic usage:

```
let a = [1, 2, 3];

let mut iter = a.iter().map(|x| 2 * x);

assert_eq!(iter.next(), Some(2));
assert_eq!(iter.next(), Some(4));
assert_eq!(iter.next(), Some(6));
assert_eq!(iter.next(), None);
```

If you're doing some sort of side effect, prefer [`for`] to `map()`:

```
# #![allow(unused_must_use)]
// don't do this:
(0..5).map(|x| println!("{x}"));

// it won't even execute, as it is lazy. Rust will warn you about this.

// Instead, use a for-loop:
for x in 0..5 {
    println!("{x}");
}
```

align_ext::AlignExt::align_down.doc:
Returns to the greatest number that is smaller than or equal to
`self` and is a multiple of the given power of two.

The method panics if `power_of_two` is not a
power of two or is smaller than 2 or the calculation overflows
because `self` is too large. In release mode,

# Examples

```
use crate::align_ext::AlignExt;
assert_eq!(12usize.align_down(2), 12);
assert_eq!(12usize.align_down(4), 12);
assert_eq!(12usize.align_down(8), 8);
assert_eq!(12usize.align_down(16), 0);
```

core::slice::<impl [T]>::iter_mut.doc:
Returns an iterator that allows modifying each value.

The iterator yields all items from start to end.

# Examples

```
let x = &mut [1, 2, 4];
for elem in x.iter_mut() {
    *elem += 2;
}
assert_eq!(x, &[3, 4, 6]);
```

core::iter::Iterator::filter.doc:
Creates an iterator which uses a closure to determine if an element
should be yielded.

Given an element the closure must return `true` or `false`. The returned
iterator will yield only the elements for which the closure returns
`true`.

# Examples

Basic usage:

```
let a = [0i32, 1, 2];

let mut iter = a.into_iter().filter(|x| x.is_positive());

assert_eq!(iter.next(), Some(1));
assert_eq!(iter.next(), Some(2));
assert_eq!(iter.next(), None);
```

Because the closure passed to `filter()` takes a reference, and many
iterators iterate over references, this leads to a possibly confusing
situation, where the type of the closure is a double reference:

```
let s = &[0, 1, 2];

let mut iter = s.iter().filter(|x| **x > 1); // needs two *s!

assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), None);
```

It's common to instead use destructuring on the argument to strip away one:

```
let s = &[0, 1, 2];

let mut iter = s.iter().filter(|&x| *x > 1); // both & and *

assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), None);
```

or both:

```
let s = &[0, 1, 2];

let mut iter = s.iter().filter(|&&x| x > 1); // two &s

assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), None);
```

of these layers.

Note that `iter.filter(f).next()` is equivalent to `iter.find(f)`.

core::iter::Iterator::filter_map.doc:
Creates an iterator that both filters and maps.

The returned iterator yields only the `value`s for which the supplied
closure returns `Some(value)`.

`filter_map` can be used to make chains of [`filter`] and [`map`] more
concise. The example below shows how a `map().filter().map()` can be
shortened to a single call to `filter_map`.

[`filter`]: Iterator::filter
[`map`]: Iterator::map

# Examples

Basic usage:

```
let a = ["1", "two", "NaN", "four", "5"];

let mut iter = a.iter().filter_map(|s| s.parse().ok());

assert_eq!(iter.next(), Some(1));
assert_eq!(iter.next(), Some(5));
assert_eq!(iter.next(), None);
```

Here's the same example, but with [`filter`] and [`map`]:

```
let a = ["1", "two", "NaN", "four", "5"];
let mut iter = a.iter().map(|s| s.parse()).filter(|s| s.is_ok()).map(|s| s.unwrap());
assert_eq!(iter.next(), Some(1));
assert_eq!(iter.next(), Some(5));
assert_eq!(iter.next(), None);
```

core::iter::IntoIterator::into_iter.doc:
Creates an iterator from a value.

See the [module-level documentation] for more.

[module-level documentation]: crate::iter

# Examples

```
let v = [1, 2, 3];
let mut iter = v.into_iter();

assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());
assert_eq!(None, iter.next());
```

core::iter::Iterator::next.doc:
Advances the iterator and returns the next value.

Returns [`None`] when iteration is finished. Individual iterator
implementations may choose to resume iteration, and so calling `next()`
again may or may not eventually start returning [`Some(Item)`] again at some
point.

[`Some(Item)`]: Some

# Examples

```
let a = [1, 2, 3];

let mut iter = a.into_iter();

// A call to next() returns the next value...
assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());

// ... and then None once it's over.
assert_eq!(None, iter.next());

// More calls may or may not return `None`. Here, they always will.
assert_eq!(None, iter.next());
assert_eq!(None, iter.next());
```

